import React from 'react';

export function Header () {
    return (
        <div class="header">
            <a href="#how-it-works">how</a>
            <a id="nav-icon" href=".header">
                <img class="logo" src={require("../images/logo-white.png")}/>
            </a>
            <a href="#contact-us">contact</a>
        </div>
    );
}

export function Footer () {
    return (
        <div class="footer">
            <p>facebook</p>
            <p>instagram</p>
            <p>pininterest</p>
            <p>google+</p>
        </div>
    );
}
